#include <stdio.h>
#include <string.h>
#include <math.h>
#include <stdlib.h>

#define LEN 650
#define D(x) ((x) - '0')
#define C(x) ((x) + '0')

signed char s[LEN] = ""
;
signed char pat[] = {0, 1, 0, -1}, t[LEN];

int main() {
    for(int _ = 0; _ < 100; _++) {
        memcpy(t, s, LEN);
        for(int n = 0; n < LEN; n++) {
            int r = 0;
            for(int p = 0; p < LEN; p++)
                r += D(t[p]) * pat[((p + 1) / (n + 1)) % 4];
            s[n] = C(abs(r) % 10);
        }
    }
    printf("%.*s\n", 8, s);
}
